    min_changes = float('inf')
    n = len(arr)
    for i in range(1, n // 2 + 1):
        left_half = arr[:i]
        right_half = arr[n - i:]
        reversed_right_half = right_half[::-1]
        mismatches = count_mismatches(left_half, reversed_right_half)
        min_changes = min(min_changes, mismatches)
    return min_changes

